define(["jquery","QUnit"],function($,t){"use strict";t.test("A Basic Test",function(t){t.ok(!0,"Passed!")}),t.test("jQuery add test",function(t){var e=$("<div>").add("<p>"),n=$("<div>"),s=$("<p>");t.ok(e.get(0).isEqualNode(n.get(0)),"The first element is a div element"),t.ok(e.get(1).isEqualNode(s.get(0)),"The first element is a p element")}),t.test("jQuery focusin",function(t){var e=t.async();$(".test-input").focusin(function(n){t.ok(n instanceof Object,"Test that the focusin method triggers an event"),e()}),document.getElementsByClassName("test-input")[0].focus()}),t.test("jQuery load",function(t){var e=t.async();$(".test-elem").load("test-doc.json",function(){t.notEqual(document.getElementsByClassName("test-elem")[0].innerHTML,"","Test that the load function loads a json doc"),e()})}),t.start()});